  \"Status of the merlin (Falco c. columbarius) in interior Alaska: 1988 progress
  report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:43.716804\",\n\t\"name\":
  \"status-of-the-merlin-falco-c-columbarius-in-interior-alaska-1988-progress-report\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"We found 16 nests during 1988 with an additional
  brood being observed in late July. Mean clutch size for 1988 was 4.6 eggs per nest
  found. We attempted to capture adults at 15 nest sites. We captured 28 or 93 percent
  of the 30 adults. A total of 63 nestlings were banded from 5-27 July. Radio-telemetry
  data were collected for a total of 25.5 hours over 9 days from 11 to 30 July. We
  continued to experience phenomenal success capturing adults using a great horned
  owl as a lure. We were concerned that adults experienced with this trapping technique
  would be less likely to be re-trapped than inexperienced birds, but it appears that
  prior captures do not influence the likelihood that a merlin will be caught again.\",\n\t\"license_title\":
